// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

// No importamos el 721 por herencia para evitar conflitos entre ambos contratos
// ya que muchas de sus funciones comparten nombre.

contract Lottery is ERC20, Ownable {

    // ====================================
    //          Gestin de tokens
    // ====================================

    // Direccin del contrato NFT del proyecto

    address public nft;

    // Constructor
    constructor() ERC20("Lottery", "LOT") {
        _mint(address(this),1000);
        nft = address(new mainERC721());
    }

    // Ganador del premio
    address public winnerAddress;

    // Registro de usuario
    mapping(address => address) internal user_contract;

    // Precio de los tokens ERC20
    function tokenPrice(uint _numtokens) internal pure returns(uint) {
        return _numtokens * (1 ether);
    }

    // Visualizacin del balance de tokens ERC220 del usuario
    function balanceTokens(address _account) public view returns(uint) {
        return balanceOf(_account);
    }

    // Visualizacin del balance de tokens ERC220 del SC
    function balanceTokensSC() public view returns(uint) {
        return balanceOf(address(this));
    }

    // Visualizacin del balance de ethers del SC
    function balanceEthersSC() public view returns (uint) {
        return address(this).balance / 10**18;
    }

    // Generacin de nuevos tokens ERC20
    function _mintNewTokens(uint amount) public onlyOwner returns(bool) {
        _mint(address(this),amount);
        return true;
    }

    // Registro de usuarios
    function signUp() internal {
        address addr_personal_contract = address(new NFTTickets(msg.sender, address(this) ,nft));
        user_contract[msg.sender] = addr_personal_contract;
    }

    // Informacin de un usuario
    function usersInfo(address _account) public view returns(address) {
        return user_contract[_account];
    }

    // Compra de tokens ERC20
    function buyTokens(uint _amount) public payable {
        // Registro del usuario
        if (user_contract[msg.sender] == address(0)) {
            signUp();
        }

        // Establecimiento del coste de los token a comprar.
        uint tokensCost = tokenPrice(_amount);

        // Evaluacin del envo de Ether por parte del usuario.
        require(msg.value >= tokensCost, "The amount sent is not enough to buy the requested tokens.");

        // Obtencion del nmero de tokens disponibles
        uint availableTokens = balanceTokensSC();

        // Evaluacin de los tokens ERC20 disponibles para su venta
        require(availableTokens >= _amount, "There are not enough available tokens to complete the purchase.");

        // Devolucin de los ethers sobrantes en la compra
        uint returnValue = msg.value - tokensCost;

        // El Smart Contract devuelve los ethers sobrantes
        payable(msg.sender).transfer(returnValue);

        // Enviamos los Tokens ERC20 al usuario
        _transfer(address(this), msg.sender, _amount);
    }

    // Devolucin de tokens ERC20 al SC.
    function returnTokens(uint _amount) public payable {

        // El numero de tokens debe ser mayor a 0
        require(_amount > 0, "The requested amount must be greater than zero.");

        // El usuario debe tener la cantidad de tokens a devolver.
        require(balanceTokens(msg.sender) >= _amount, "Your tokens balance must be greater than the requested amount.");

        // El usuario transfiere los tokens al SC.
        _transfer(msg.sender, address(this), _amount);

        // El SC enva los ethers al usuario.
        uint tokensCost = tokenPrice(_amount);
        payable(msg.sender).transfer(tokensCost);
    }


    // ====================================
    //        Gestin de la loteria
    // ====================================

    // Precio del boleto de lotera en tokens ERC20
    uint ticketPrice = 5;

    // Relacin persona que compra boletos con los nmeros de los boletos comprados
    mapping(address => uint []) userID_Tickets;

    // Relacin boleto con ganador
    mapping(uint => address) Ticketdna;

    // Nmeros aleatorio
    uint randNonce = 0;

    // Boletos de lotera generados
    uint [] generatedTickets;

    // Compra de boletos de lotera
    function buyTickets( uint _amount) public {

        uint totalPrice = _amount * ticketPrice;

        require(balanceTokens(msg.sender) >= totalPrice, "Your token balance is not enough to buy this amount of Lottery tickets.");

        // Transferencia de tokens al SC.
        _transfer(msg.sender, address(this), totalPrice);

        // Minteo de los tickets para el usuario
        for (uint i; i < _amount; i++) {

            uint random = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, randNonce))) % 100000;
            randNonce++;

            // Almacenamiento de los datos del boleto enlazado al usuario
            userID_Tickets[msg.sender].push(random);

            // Almacenamiento de los datos de los boletos
            generatedTickets.push(random);

            // Asignacin del ADN del boleto para la generacin de un ganador.
            Ticketdna[random] = msg.sender;

            // Creacin de un nuevo NFT para ese nmero de boleto
            NFTTickets(user_contract[msg.sender]).TicketMint(msg.sender,random);
        }
    }

    // Visualizacin de los boletos del usuario
    function myTickets(address _owner) public view returns(uint [] memory) {
        return userID_Tickets[_owner];
    }

    // Generacion del ganador de la loteria
    function getLotteryWinner() public onlyOwner {

        // Generamos un nmero aleatorio entre el total de tickets comprados
        uint totalTickets = generatedTickets.length;

        // Verificamos si se ha vendido al menos 1 boleto
        require(totalTickets > 0, "There are not ticket bought.");

        // Eleccin aleatoria entre 0 y el nmero total de boletos comprados
        uint random = uint(uint(keccak256(abi.encodePacked(block.timestamp))) % totalTickets);

        // Seleccin del nmero aleatorio
        uint winnerNumber = generatedTickets[random];

        // Direccin del ganador
        winnerAddress = Ticketdna[winnerNumber];

        // Envo del 95% de la recaudacin de la lotera al ganador
        uint prize = (address(this).balance / 100) * 95;
        payable(winnerAddress).transfer(prize);

        // Envo del beneficio al Owner
        uint profit = address(this).balance;
        payable(owner()).transfer(profit);
    }

    /*function checkTicketIsUnique(uint _ticket) internal view returns(bool) {
        bool unique = true;
        for (uint i; i < generatedTickets.length; i++) {
            if (_ticket == generatedTickets[i]) {
                unique = false;
            }
        }
        return unique;
    }*/
}


// Smart Contract de NFTs
contract mainERC721 is ERC721 {

    address AddressLottery;
    constructor() ERC721("Lottery Tickets","LTICK") {
        AddressLottery = msg.sender;
    }

    // Creacin de los NFTs
    function safeMint(address _owner, uint _ticketNumber) public {  // Esta funcin al ser llamada en un contrato declarado SIN HERENCIA
                                                                    // debe ser pblica, no sirve como internal.
        require(msg.sender == Lottery(AddressLottery).usersInfo(_owner), "You are not allowed to mint these NFTs.");
        _safeMint(_owner, _ticketNumber);
    }
}


contract NFTTickets {

    // Datos relevantes del propietario
    struct Owner {
        address ownerAddress;
        address lotteryContractAddress;
        address NFTTicketsContractAddress;
        address ownerContractAddress;
    }

    Owner public ownerData;

    constructor(address _ownerAddress, address _lotteryContract, address _NFTTicketsContract) {
        ownerData = Owner(_ownerAddress, _lotteryContract, _NFTTicketsContract, address(this));
    }

    function TicketMint(address _owner, uint _ticket) public {
        require(msg.sender == ownerData.lotteryContractAddress, "You are not allowed to mint these NFTs.");
        mainERC721(ownerData.NFTTicketsContractAddress).safeMint(_owner, _ticket);
    }

}
